import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faGithub } from "@fortawesome/free-brands-svg-icons";

const Projects = () => {
  return (
    <div>
      <h1 className="text-4xl dark:text-white text-black font-bold font-merriweather text-center py-10">
        Projects
      </h1>

      <div className="">
        <h1 className="text-2xl dark:text-white text-black font-merriweather text-center">
          Doctor Clinic Management System
        </h1>
        <a href="" target="_blank" className="text-xl dark:text-white text-black ">
          <FontAwesomeIcon icon={faGithub} />
        </a>
      </div>
    </div>
  );
};

export default Projects;
